import * as aliasClient from './datasetAliasesClient';
import { ALIAS_PREFIX } from './datasetAliasesClient';
export const listAliasesHandler = async (args, context) => {
  const {
    apiClient,
    output
  } = context;
  const client = apiClient();
  const aliases = await aliasClient.listAliases(client);
  output.print(aliases.map(set => "".concat(ALIAS_PREFIX).concat(set.name, " -> ").concat(set.datasetName || '<unlinked>')).join('\n'));
};